 ('1', '25', 'en_us', 'b.jazzy.w@gmail.com', 'My ------- driver\'s license says my name is Brittany, but most call me Jazzy.  I\'m a digital creative type currently living in Portland, Oregon, but will be soon moving to the Central Valley (sept 2017).  I have a passion for design and technology and enjoy making them work well together.  I have a degree in architecture, this background has provided me with a unique perspective when approaching design and technological problems.  I love to collaborate, let\'s make something together!', '', '', 'open for freelance', '', '2017-08-26 19:16:08', '2017-08-27 03:50:31', '216196d5-87a6-491a-ba45-2adf4b1c2647');



