INSERT INTO `craft_matrixcontent_galleryitem` (`id`, `elementId`, `locale`, `field_projectInfo_projectTitle`, `field_projectInfo_clientName`, `field_projectInfo_devStack`, `field_projectInfo_agencyName`, `field_projectInfo_myRole`, `field_projectInfo_websiteLink`, `field_projectInfo_projectBlurb`, `dateCreated`, `dateUpdated`, `uid`) VALUES
 ('1', '6', 'en_us', 'Pasted.io', 'Pasted App ', 'javascript', 'The Brigade', 'lead developer', 'http://www.pasted.io/', '<p>Pasted.io: the launch page for Pasted app, showcasing all the unique features the app has to offer as well as a gallery.</p>', '2017-08-16 04:22:34', '2017-09-01 05:45:53', '86682ab5-eef3-4c62-8076-8d3ecbfddffa'),
 ('4', '11', 'en_us', 'Meme generator', 'Global Citizen', 'javascript / canvas', 'The Brigade', 'lead developer', 'https://thisisamerica.globalcitizen.org/', '<p>In response to the current political climate nonprofit Global Citizen wanted to create a platform where people could make a statement and share it publicly through their social media channels. #thisisamerica</p>', '2017-08-19 17:05:20', '2017-09-01 05:42:35', '3f68e4aa-82ad-4a2b-accc-994951c464e1'),
 ('5', '13', 'en_us', 'Listen Up!', 'Redbull', 'javascript / soundcloud API / middleman', 'The Program', 'lead developer', 'http://listen.redbull.com/', '<p>micosite built to announce four featured artists, and bring attention to Redbull\'s music labels: Sound Select &amp; Redbull Records.</p>', '2017-08-19 18:19:53', '2017-09-01 05:59:45', 'ce24c5f2-77e1-4b9a-aeeb-f14598edef22'),
 ('6', '15', 'en_us', 'New Product Banners', 'Nike', 'javascript', 'The Program', 'lead developer', '', '<p>These banners lived on some top sneaker retail sites including Finish Line, East Bay &amp; Foot Action.  Their purpose was to give the user detailed information about new products without disrupting the standard shopping experience.</p>', '2017-08-19 18:21:46', '2017-09-06 01:40:21', 'c8d84605-e220-4f2c-868e-8709f137414b'),
 ('7', '21', 'en_us', 'ecommerce store', 'Aly + Jay', 'custom shopify ', 'The Program', 'lead developer', 'https://ali-jay.com/', '<p>clean online store </p>', '2017-08-21 07:20:38', '2017-09-01 16:41:15', '87ae50fd-e1cb-4623-bb94-9a22b918ab3e'),
 ('8', '22', 'en_us', 'Advanced Search', 'Nike', 'javascript', 'The Program', 'lead developer', '', '<p>These advanced search modules lived on top sneaker retail sites including Foot Locker, Foot Action &amp; EastBay.  Their purpose was to give the user a comprehensive and interactive view of the entire collection all a once, and also allow them to purchase items directly from the interactive experience.</p>', '2017-08-21 07:20:47', '2017-09-01 16:44:17', '9e0a1fb3-4265-4454-9d5d-045392eb51d4'),
 ('9', '23', 'en_us', 'Art of Can', 'Redbull', 'middleman / javascript', 'The Program', 'second developer', 'http://www.redbullartofcan.com/', '<p>Art of Can is a contest that challenges artists to create their best works using only Redbull cans.  This site showcases the artists and their artwork.</p>', '2017-08-21 07:20:56', '2017-09-01 16:46:03', 'a019a3f2-0ea9-4a59-bf62-e2a7a31e1c65'),
 ('10', '24', 'en_us', 'Mozilla Business Affairs', 'Mozilla', 'wordpress, javascript', 'The Brigade', 'lead developer', 'https://blog.mozilla.org/businessaffairs/', '<p>Always interested in sharing information and communicating with the public Business Affairs blog is just one avenue Mozilla uses to continue to spread its open source message and keep people informed on what they are currently working on.</p>', '2017-08-21 07:21:06', '2017-09-01 16:40:43', 'df68f8fe-d920-4974-9d19-9b793ccde787');



